  assemblies:
  - dotNetRDF
  namespace: VDS.RDF.Query.Inference
  summary: "\nWrapper around an <xref href=\"VDS.RDF.Query.Inference.IOwlReasoner\" data-throw-if-not-resolved=\"false\"></xref> to make it appear like a forward-chaining reasoner.\n"
  remarks: "\nEssentially all this class does is extract all triples which the underlying reasoner can infer.  Currently the input graph and any graph passed to the <xref href=\"VDS.RDF.Query.Inference.IInferenceEngine.Initialise(VDS.RDF.IGraph)\" data-throw-if-not-resolved=\"false\"></xref> method have no effect on the output of the reasoner.\n"
